('3984d138-8e30-44db-a40c-30b71ef2274e', '[TSP-SyRTC-0025]', '"source":"[TSP-SyRS-0137],[TSP-SyRS-0329],[TSP-SyRS-0426]","safety":"Yes","test case description":"Check that TSP shall communicate with external device through GGW-R and GGW-B.","test method":"EP"', '\n#!/usr/bin/python\n# -*- coding:utf-8 -*-\n#----------------------------------------------------------------------------\n# FileName:     checklog.py\n# Description:  analyse log for rtc_04 \n# Author:       OO\n# Version:      0.0.1\n# Created:      2015-11-20\n# Company:      CASCO\n# LastChange:   \n# History:      \n#----------------------------------------------------------------------------\n"""Usage: checklog.py FILE1 FILE2\n\nfor example test library.\n\nArguments:\n  FILE1     input file1\n  FILE2     input file2\n"""\n\nfrom docopt import docopt\nfrom simulator.base.check import CheckLog\n\nif __name__ == ''__main__'':\n    arguments = docopt(__doc__)\n\n    _case = CheckLog()\n    _case.setSeparator()\n    _case.setKeyName()\n    _case.setDiffRule(''123'', ''user_info'', ''SHB_CKW_2'', ''MainCKW_1'', ''MainCKW_2'')\n    _case.setRepeatRule(''all'', 1, ''****************** Send BSD message!!'')\n    _case.analysisLog(arguments[''FILE1''])\n    _case.setRepeatRule(3, 2, ''****************** Receive SSE message!!'')\n    _case.setRepeatRule(9, 2, ''****************** Receive SSE message!!'')\n    _case.analysisLog(arguments[''FILE2''])\n    _case.outputLog()\n   \n}\n', '', '', '', '', '', '', '', '', 0, '', '4afb1f15-a958-4934-a291-a17198144aca', '2015-11-24 10:40:30', '2015-12-08 14:05:34'),
