(700, 'ea3139d6-c523-4095-ab96-14f40e13e69c', NULL, '', 'Run MPS-A and MPS-B.', 'SDMS shows the working status about MPS-A starts as Normal and MPS-B starts as Reserve. The lights on STBY display correct.MPS-A can exchange information with external devices  through red and blue network;MPS-B can reveive messages from external devices, but not send messages to external devices through red and blue network.The messages include RSSP-I, RSSP-II, Subset-37.', '2015-11-24 10:36:31', '2015-11-24 10:36:31'),
(701, 'ea3139d6-c523-4095-ab96-14f40e13e69c', NULL, '', 'Switch the STBY key to B position.', 'MPS-B switches to Normal next cycle.MPS-A switches to Reverse after two cycles.The lights on STBY display correct.The working status changed will display on SDMS.TSP can not send message to exteral devices for the first cycle.MPS-B can exchang information with external devices except the first cycle through red and blue network;MPS-A can reveive messages from external devices, but not send messages to external devices except the first cycle through red and blue network.The messages include RSSP-I, RSSP-II, Subset-37.', '2015-11-24 10:36:31', '2015-11-24 10:36:31'),
(702, 'ea3139d6-c523-4095-ab96-14f40e13e69c', NULL, '', 'Switch the STBY key to Auto position.', 'MPS-A still works as Reserve.MPS-B still works as Normal.The lights on STBY display correct.The working status changed will display on SDMS.The communications between TSP and all the external devices are normal.', '2015-11-24 10:36:31', '2015-11-24 10:36:31'),
(703, 'ea3139d6-c523-4095-ab96-14f40e13e69c', NULL, '', 'Switch the STBY key to A position.', 'MPS-A changed to MPS-N next cycle.MPS-B changed to MPS-R after two cycles.The lights on STBY display correct.The working status changed will display on SDMS.APP simulator of MPS-A can exchang information with external devices except the first cycle through red and blue network;APP simulator of MPS-B can reveive messages from external devices, but not send messages to external devices except the first cycle through red and blue network.The messages include RSSP-I, RSSP-II, Subset-37.', '2015-11-24 10:36:31', '2015-11-24 10:36:31'),
