(707, '80e13c54-3656-480f-b000-4f7e763a0395', NULL, '', 'Capture messages from TSP and NTP server using wireshark.', 'TSP will send time request messageto NTP Server.The time interval between two request is <60sThe port is 123The protocol layer:L2: EthernetL3:IPL4:UDPThe next layer is : SNTP', '2015-11-24 10:36:31', '2015-11-24 10:36:31'),
