(710, 'cbf937b5-b2fa-43ea-8a92-a4ff981ee5be', NULL, '', 'Power on TSP.Set MPS-A as MPS-N and MPS-B as MPS-R.Plug out the serial cable which used to synchronize the clock between MPS-A and MPS-B.', 'SDMS shows the alarming information about NR not synchronized.MPS-A still works as Normal.MPS-B works as Offline.', '2015-11-24 10:36:32', '2015-11-24 10:36:32'),
