(712, 'cbf937b5-b2fa-43ea-8a92-a4ff981ee5be', NULL, '', 'Power off TSP.Plug in the serial cable which used to synchronize the clock between MPS-A and MPS-B.Power on MPS-B, and than power on MPS-A.', 'MPS-A works as Reverse.MPS-B works as Normal.', '2015-11-24 10:36:32', '2015-11-24 10:36:32'),
(713, 'cbf937b5-b2fa-43ea-8a92-a4ff981ee5be', NULL, '', 'Plug out the network cable which used to synchronize the data between MPS-A and MPS-B.', 'SDMS shows the alarming information about NR not synchronized.MPS-A works as Offline.MPS-B still works as Normal.', '2015-11-24 10:36:32', '2015-11-24 10:36:32'),
