(721, '50b5c746-6969-4217-b0dc-220d54873b8b', NULL, '', 'Use wireshark to get the message between TSP and Minit.', 'From wireshark, TSP  communicate with Minit via SNMP v2  protocol.The request destport from Minit is 161The response dest port from TSP is 161.The protocol layer:L2: EthernetL3:IPL4:UDPThe next layer is : SNMP', '2015-11-24 10:36:32', '2015-11-24 10:36:32'),
(722, '50b5c746-6969-4217-b0dc-220d54873b8b', NULL, '', 'Let MPS-B shutdown. First start MPS-A and then start MPS-B.', 'MPS-A  works as MPS-N and MPS-B works as MPS-RThe stateLruCounter of state is 18.', '2015-11-24 10:36:32', '2015-11-24 10:36:32'),
(723, '50b5c746-6969-4217-b0dc-220d54873b8b', NULL, '', 'Delete the red IP of Minit, Configure the Bule IP of Minit.Run Minit and select GGW-B as agent.', 'Minit can request the state of LRU s ', '2015-11-24 10:36:32', '2015-11-24 10:36:32'),
