(1129, '0176cf26-f291-486e-867e-533cec785a9d', NULL, '', 'Check the state of GGW-R, GGW-B, MPU1/2-A, MCU-A, MPU1/2-B, MCU-B, FAN-A, FAN-B, SDMS.', 'The lruNumber is 11.All the state of these LRU is 1.The stateLruCounter of state is 0.', '2015-11-24 10:40:40', '2015-11-24 10:40:40'),
(1130, '0176cf26-f291-486e-867e-533cec785a9d', NULL, '', 'Let the APP of  MPU1-A  run timeout and then check the state of GGW-R, GGW-B, MPU1/2-A,MCU-A, MPU1/2-B,MCU-B, FAN-A, FAN-B,SDMS.', 'MPS-A shutdown and MPS-B works as MPS-N;The state of MPU1/2-A, MCU-A  are  2.The stateLruCounter of state is 3.The state of MPU1/2-B, MCU-B, FAN-B, GGW-R, GGW-B, SDMS are 1.', '2015-11-24 10:40:40', '2015-11-24 10:40:40'),
(1131, '0176cf26-f291-486e-867e-533cec785a9d', NULL, '', 'Use wireshark to get the message between TSP and Minit.', 'From wireshark, TSP  communicate with Minit via SNMP v2  protocol.The request destport from Minit is 161The response dest port from TSP is 161.The protocol layer:L2: EthernetL3:IPL4:UDPThe next layer is : SNMP', '2015-11-24 10:40:40', '2015-11-24 10:40:40');
